import{_ as t,a as e,b as r,c as a}from"./chunks/settings_view_general_rtk_gps.CmoByRPo.js";import{_ as l,c as n,o as i,ab as s}from"./chunks/framework.CUflZczI.js";const P=JSON.parse('{"title":"RTK GPS","description":"","frontmatter":{},"headers":[],"relativePath":"ko/gps_compass/rtk_gps.md","filePath":"ko/gps_compass/rtk_gps.md"}'),d={name:"ko/gps_compass/rtk_gps.md"},o=s('<h1 id="rtk-gps" tabindex="-1">RTK GPS <a class="header-anchor" href="#rtk-gps" aria-label="Permalink to &quot;RTK GPS&quot;">​</a></h1><p><a href="https://en.wikipedia.org/wiki/Real_Time_Kinematic" target="_blank" rel="noreferrer">Real Time Kinematic (RTK)</a> GNSS/GPS systems provide centimeter-level accuracy, allowing PX4 to be used in applications like precision surveying (where pinpoint accuracy is essential).</p><p>This feature requires <em>QGroundControl</em> running on a laptop/PC and a vehicle with a WiFi or Telemetry radio link to the ground station laptop.</p><div class="info custom-block"><p class="custom-block-title">Some RTK GNSS setups can provide yaw/heading information, as an alternative to the compass:</p><ul><li><a href="./../gps_compass/u-blox_f9p_heading.html">듀얼 u-blox F9P를 사용한 RTK GPS 헤딩</a>.</li><li>GPS directly output yaw (see table below).</li></ul><p>PX4는 <a href="https://www.u-blox.com/en/product/neo-m8p" target="_blank" rel="noreferrer">u-blox M8P</a>, <a href="https://www.u-blox.com/en/product/zed-f9p-module" target="_blank" rel="noreferrer">u-blox F9P</a> 및 <a href="https://www.trimble.com/Precision-GNSS/MB-Two-Board.aspx" target="_blank" rel="noreferrer">Trimble MB-Two</a> GPS와 통합 제품을 지원합니다.</p><h2 id="지원되는-rtk-장치" tabindex="-1">지원되는 RTK 장치 <a class="header-anchor" href="#지원되는-rtk-장치" aria-label="Permalink to &quot;지원되는 RTK 장치&quot;">​</a></h2><p>PX4 supports the <a href="https://www.u-blox.com/en/product/neo-m8p" target="_blank" rel="noreferrer">u-blox M8P</a>, <a href="https://www.u-blox.com/en/product/zed-f9p-module" target="_blank" rel="noreferrer">u-blox F9P</a> and the <a href="https://www.trimble.com/Precision-GNSS/MB-Two-Board.aspx" target="_blank" rel="noreferrer">Trimble MB-Two</a> GPS, and products that incorporate them.</p><p>:::note 일부 RTK 모듈은 특정 기능(베이스 또는 로버)으로만 사용할 수 있는 반면, 다른 모듈은 서로 교환하여 사용할 수 있습니다. The table indicates devices that also output yaw, and that can provide yaw when two on-vehicle units are used. It also highlights devices that connect via the CAN bus, and those which support PPK (Post-Processing Kinematic).</p><table><thead><tr><th style="text-align:left;">Device</th><th style="text-align:center;">GPS</th><th style="text-align:center;">Compass</th><th style="text-align:center;"><a href="./../dronecan/">DroneCAN</a></th><th style="text-align:center;"><a href="#configuring-gps-as-yaw-heading-source">GPS Yaw</a></th><th style="text-align:center;"><a href="./../gps_compass/u-blox_f9p_heading.html">Dual F9P GPS Heading</a></th><th style="text-align:center;">PPK</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://arkelectron.com/product/ark-rtk-gps/" target="_blank" rel="noreferrer">ARK RTK GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">ICM42688p</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk.html">CUAV C-RTK GPS</a></td><td style="text-align:center;">M8P/M8N</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk2.html">CUAV C-RTK2</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk-9ps.html">CUAV C-RTK 9Ps GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">RM3100</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk.html">CUAV C-RTK2 PPK/RTK GNSS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">RM3100</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_hex_hereplus.html">CubePilot Here+ RTK GPS</a></td><td style="text-align:center;">M8P</td><td style="text-align:center;">HMC5983</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://www.cubepilot.org/#/here/here3" target="_blank" rel="noreferrer">CubePilot Here3 CAN GNSS GPS (M8N)</a></td><td style="text-align:center;">M8P</td><td style="text-align:center;">ICM20948</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://store-drotek.com/911-sirius-rtk-gnss-rover-f9p.html" target="_blank" rel="noreferrer">Drotek SIRIUS RTK GNSS ROVER (F9P)</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">RM3100</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_fem_mini2.html">Femtones MINI2 Receiver</a></td><td style="text-align:center;">FB672, FB6A0</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_freefly.html">Freefly RTK GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://holybro.com/products/h-rtk-f9p-ultralight" target="_blank" rel="noreferrer">Holybro H-RTK F9P Ultralight</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_h-rtk-f9p.html">Holybro H-RTK F9P Helical or Base</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://holybro.com/products/dronecan-h-rtk-f9p-helical" target="_blank" rel="noreferrer">Holybro DroneCAN H-RTK F9P Helical</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">BMM150</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_h-rtk-f9p.html">Holybro H-RTK F9P Rover Lite</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://holybro.com/products/dronecan-h-rtk-f9p-rover" target="_blank" rel="noreferrer">Holybro DroneCAN H-RTK F9P Rover</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">BMM150</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_h-rtk-m8p.html">Holybro H-RTK M8P GNSS</a></td><td style="text-align:center;">M8P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_unicore_um982.html">Holybro H-RTK Unicore UM982 GPS</a></td><td style="text-align:center;">UM982</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_locosys_r1.html">LOCOSYS Hawk R1</a></td><td style="text-align:center;">MC-1612-V2b</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_locosys_r2.html">LOCOSYS Hawk R2</a></td><td style="text-align:center;">MC-1612-V2b</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://store.mrobotics.io/product-p/m10020d.htm" target="_blank" rel="noreferrer">mRo u-blox ZED-F9 RTK L1/L2 GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/septentrio_asterx-rib.html">Septentrio AsteRx-m3 Pro</a></td><td style="text-align:center;">AsteRx</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;">Septentrio dual antenna heading</td><td style="text-align:center;">✓</td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/septentrio_mosaic-go.html">Septentrio mosaic-go</a></td><td style="text-align:center;">mosaic X5 / mosaic H</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;">Septentrio dual antenna heading</td><td style="text-align:center;">✓</td></tr><tr><td style="text-align:left;"><a href="https://store-drotek.com/911-sirius-rtk-gnss-rover-f9p.html" target="_blank" rel="noreferrer">SIRIUS RTK GNSS ROVER (F9P)</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://www.sparkfun.com/products/15136" target="_blank" rel="noreferrer">SparkFun GPS-RTK2 Board - ZED-F9P</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_trimble_mb_two.html">Trimble MB-Two</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table><p>RTK GPS 설정은 <em>QGroundControl</em> <a href="https://docs.qgroundcontrol.com/en/SettingsView/General.html#rtk_gps" target="_blank" rel="noreferrer">일반 설정</a> (**SettingsView &gt; 일반 설정 &gt; RTK GPS **)에서 지정됩니다.</p><ul><li>✓ or a specific part number indicate that a features is supported, while ✗ or empty show that the feature is not supported. &quot;?&quot; indicates &quot;unknown&quot;.</li><li>Where possible and relevant the part name is used (i.e. ✓ in the GPS column indicates that a GPS module is present but the part is not known).</li><li>Some RTK modules can only be used in a particular role (base or rover), while others can be used interchangeably.</li><li>The list may omit some discontinued hardware that is still supported. For example <a href="./../gps_compass/rtk_gps_hex_hereplus.html">CubePilot Here+ RTK GPS</a> is discontinued and may be removed from the list in a future release. Check earlier versions if a discontinued module is not mentioned here.</li></ul><h2 id="포지셔닝-설정" tabindex="-1">포지셔닝 설정 <a class="header-anchor" href="#포지셔닝-설정" aria-label="Permalink to &quot;포지셔닝 설정&quot;">​</a></h2><p>RTK positioning requires a <em>pair</em> of <a href="#supported-devices">RTK GNSS devices</a>: a &quot;base&quot; for the ground station and a &quot;rover&quot; for the vehicle.</p><p>추가로 다음과 같은 것들이 필요합니다.</p><ul><li>A <em>laptop/PC</em> with QGroundControl (QGroundControl for Android/iOS do not support RTK)</li><li>노트북에 WiFi 또는 원격 텔레메트리 링크가 있는 기체.</li></ul><div class="info custom-block"><p class="custom-block-title"><em>QGroundControl</em> with a base module can theoretically enable RTK GPS for multiple vehicles/rover modules. 이 문서 작성 시점에서 이것의 사용 사례는 테스트되지 않았습니다.</p></div></div><h3 id="하드웨어-설정" tabindex="-1">하드웨어 설정 <a class="header-anchor" href="#하드웨어-설정" aria-label="Permalink to &quot;하드웨어 설정&quot;">​</a></h3><h4 id="로버-rtk-모듈-차량" tabindex="-1">로버 RTK 모듈 (차량) <a class="header-anchor" href="#로버-rtk-모듈-차량" aria-label="Permalink to &quot;로버 RTK 모듈 (차량)&quot;">​</a></h4><p>필요한 연결 방법과 케이블/커넥터는 선택한 RTK 모듈과 <a href="./../flight_controller/README.html">비행 콘트롤러</a>에 따라 달라집니다.</p><p>대부분은 다른 GPS 모듈과 같은 방식으로 비행 콘트롤러의 GPS 포트를 통해 연결됩니다. Some are connected to the <a href="./../can/">CAN</a> bus (i.e. using <a href="./../dronecan/">DroneCAN</a>).</p><p>See <a href="#supported-devices">documentation for the selected device</a>, general <a href="./../gps_compass/#hardware-setup">GNSS Hardware/Configuration Setup</a>, and <a href="./../dronecan/">DroneCAN</a> for more information on wiring and configuration.</p><h4 id="기본-rtk-모듈-접지" tabindex="-1">기본 RTK 모듈 (접지) <a class="header-anchor" href="#기본-rtk-모듈-접지" aria-label="Permalink to &quot;기본 RTK 모듈 (접지)&quot;">​</a></h4><p>Connect the base module to <em>QGroundControl</em> via USB. 기본 모듈을 사용하는 동안 이동하면 안됩니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>기본 모듈을 이동할 필요가 없는 하늘이 잘 보이고 건물과 잘 분리된 위치를 선택하십시오. 삼각대를 사용하거나 지붕에 장착하여 기본 GPS의 위치를 높이는 것이 도움이되는 경우가 많이 있습니다.</p></div><h4 id="텔레메트리-라디오-wifi" tabindex="-1">텔레메트리 라디오/WiFi <a class="header-anchor" href="#텔레메트리-라디오-wifi" aria-label="Permalink to &quot;텔레메트리 라디오/WiFi&quot;">​</a></h4><p>기체 지상제어용 노트북은 <a href="./../telemetry/README.html">wifi 또는 무선 텔레메트리 링크</a>를 통하여 연결하여야 합니다.</p><p>The link <em>must</em> use the MAVLink 2 protocol as it makes more efficient use of the channel. 기본적으로 설정되어야 하지만, 그렇지 않은 경우에는 아래 <a href="#mavlink2">MAVLink2 설정 방법</a>을 따르십시오.</p><h3 id="rtk-연결-프로세스" tabindex="-1">RTK 연결 프로세스 <a class="header-anchor" href="#rtk-연결-프로세스" aria-label="Permalink to &quot;RTK 연결 프로세스&quot;">​</a></h3><p>RTK GPS 연결은 기본적으로 플러그앤플레이입니다.</p><ol><li><em>QGroundControl</em>을 실행하고 USB를 통하여 기본 RTK GPS를 지상국에 연결합니다. 장치가 자동으로 인식됩니다.</li><li>차량의 시동을 걸고 <em>QGroundControl</em>에 연결되어 있는지 확인하십시오.</li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><em>QGroundControl</em>은 RTK GPS 장치가 연결되어 있는 동안 상단 아이콘 표시줄에 RTK GPS 상태 아이콘을 표시합니다 (일반 GPS 상태 아이콘 추가). RTK가 설정되는 동안 아이콘은 빨간색으로 표시되고, RTK GPS가 활성화되면 흰색으로 바뀝니다. 아이콘을 클릭하여 현재 상태와 RTK 정확도를 확인할 수 있습니다.</p></div><ol><li><p>그런 다음 <em>QGroundControl</em>은 RTK 설정 프로세스( &quot;Survey-In&quot;이라고 함)를 시작합니다.</p><p>Survey-In은 기지국의 정확한 위치 추정치를 획득을 위한 시작 절차입니다. 이 프로세스는 일반적으로 몇 분 정도 걸립니다 (<a href="#rtk-gps-settings">RTK 설정</a>에 지정된 최소 시간 및 정확도에 도달하면 종료됨).</p><p>RTK GPS 상태 아이콘을 클릭하여 진행 상황을 추적할 수 있습니다.</p><p><img src="'+t+'" alt="survey-in"></p></li><li><p>Survey-in이 완료되면 :</p><ul><li><p>The RTK GPS icon changes to white and <em>QGroundControl</em> starts to stream position data to the vehicle:</p><p><img src="'+e+'" alt="RTK 스트리밍"></p></li><li><p>기체의 GPS가 RTK 모드로 전환됩니다. The new mode is displayed in the <em>normal</em> GPS status icon (<code>3D RTK GPS Lock</code>):</p><p><img src="'+r+'" alt="RTK GPS 상태"></p></li></ul></li></ol><h3 id="configuring-gps-as-yaw-heading-source" tabindex="-1">Configuring GPS as Yaw/Heading Source <a class="header-anchor" href="#configuring-gps-as-yaw-heading-source" aria-label="Permalink to &quot;Configuring GPS as Yaw/Heading Source&quot;">​</a></h3><p>GPS can be used as a source for yaw fusion when using modules where <em>yaw output is supported by the device</em> (e.g. <a href="./../gps_compass/rtk_gps_trimble_mb_two.html">Trimble MB-Two</a>) or when using some <a href="./../gps_compass/u-blox_f9p_heading.html">RTK GPS Setups with Dual u-blox F9P</a>.</p><p>When using GPS for yaw fusion you will need to configure the following parameters:</p><table><thead><tr><th>Parameter</th><th>Setting</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#GPS_YAW_OFFSET">GPS_YAW_OFFSET</a></td><td>The angle made by the <em>baseline</em> (the line between the two GPS antennas) relative to the vehicle x-axis (front/back axis, as shown <a href="./../config/flight_controller_orientation.html#calculating-orientation">here</a>).</td></tr><tr><td><a href="./../advanced_config/parameter_reference.html#EKF2_GPS_CTRL">EKF2_GPS_CTRL</a></td><td>Set bit position 3 &quot;Dual antenna heading&quot; to <code>1</code> (i.e. add 8 to the parameter value).</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If using this feature, all other configuration should be setup up as normal (e.g. <a href="./../gps_compass/rtk_gps.html#positioning-setup-configuration">RTK Positioning</a>).</p></div><h3 id="선택적-px4-구성" tabindex="-1">선택적 PX4 구성 <a class="header-anchor" href="#선택적-px4-구성" aria-label="Permalink to &quot;선택적 PX4 구성&quot;">​</a></h3><p>The following settings may need to be changed (using <em>QGroundControl</em>).</p><h4 id="rtk-gps-설정" tabindex="-1">RTK GPS 설정 <a class="header-anchor" href="#rtk-gps-설정" aria-label="Permalink to &quot;RTK GPS 설정&quot;">​</a></h4><p>The RTK GPS settings are specified in the <em>QGroundControl</em> <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/settings_view/general.html#rtk_gps" target="_blank" rel="noreferrer">General Settings</a> (<strong>SettingsView &gt; General Settings &gt; RTK GPS</strong>).</p><p><img src="'+a+'" alt="RTK GPS 설정"></p><p>이러한 설정은 RTK GPS 설정 프로세스 ( &quot;Survey-In) 완료를 위한 최소 기간과 최소 정확도를 정의합니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can save and reuse a base position in order to save time: perform Survey-In once, select <em>Use Specified Base Position</em> and press <strong>Save Current Base Position</strong> to copy in the values for the last survey. 그러면 값이 변경시까지 QGC 재부팅시에도 유지됩니다.</p></div><h4 id="mavlink2" tabindex="-1">MAVLink2 <a class="header-anchor" href="#mavlink2" aria-label="Permalink to &quot;MAVLink2&quot;">​</a></h4><p>MAVLink2 프로토콜은 낮은 대역폭 채널을 보다 효율적으로 사용하기 때문에 사용하여야합니다. 이것은 최근 빌드에서 기본적으로 활성화되어야 합니다.</p><p>MAVLink2가 사용되는 지 확인하려면 :</p><ul><li>Update the telemetry module firmware to the latest version (see <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/setup_view/firmware.html" target="_blank" rel="noreferrer">QGroundControl &gt; Setup &gt; Firmware</a>).</li><li>Set <a href="./../advanced_config/parameter_reference.html#MAV_PROTO_VER">MAV_PROTO_VER</a> to 2 (see <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/setup_view/parameters.html" target="_blank" rel="noreferrer">QGroundControl Setup &gt; Parameters</a>)</li></ul><h4 id="튜닝" tabindex="-1">튜닝 <a class="header-anchor" href="#튜닝" aria-label="Permalink to &quot;튜닝&quot;">​</a></h4><p>GPS 정확도를 센티미터가 아닌 미터 단위로 가정하여 기본 매개변수가 조정되므로 일부 매개변수를 조정하여야 할 수도 있습니다. 예를 들어 <a href="./../advanced_config/parameter_reference.html#EKF2_GPS_V_NOISE">EKF2_GPS_V_NOISE</a>와 <a href="./../advanced_config/parameter_reference.html#EKF2_GPS_P_NOISE">EKF2_GPS_P_NOISE</a>를 0.2로 줄일 수 있습니다.</p><h4 id="이중-수신기" tabindex="-1">이중 수신기 <a class="header-anchor" href="#이중-수신기" aria-label="Permalink to &quot;이중 수신기&quot;">​</a></h4><p>두 번째 GPS 수신기는 백업으로 사용할 수 있습니다 (RTK 또는 비 RTK). <a href="./../advanced_config/tuning_the_ecl_ekf.html#gps">EKF2 GPS 설정</a> 섹션을 참고하십시오.</p><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="./../advanced/rtk_gps.html">RTK-GPS (PX4-Integration)</a> : RTK-GPS 지원을 PX4에 통합에 대한 개발자 정보입니다.</li><li><a href="https://en.wikipedia.org/wiki/Real_Time_Kinematic" target="_blank" rel="noreferrer">실시간 운동학</a> (Wikipedia)</li></ul>',42),c=[o];function g(h,p,m,u,y,x){return i(),n("div",null,c)}const b=l(d,[["render",g]]);export{P as __pageData,b as default};
